import React from 'react'
import { NavLink } from 'react-router-dom';

class Button extends React.Component {


  render(){
    const {sendFileBack} = this.props

    return(
      <div>
            <NavLink to='/home'><button type="button" className="btn1">Exit</button></NavLink>
            <button onClick={sendFileBack}>Next</button>
      </div>
    )
  }
}

export default Button;
